import { Grid, TextField } from '@mui/material'
import { Box, positions } from '@mui/system'
import React from 'react'
import Logo from './Logo.ico'

const Login = () => {
  return (
    <div>
         <Grid item xs={8}
           container
           direction="row"
           justifyContent="flex-start"
           alignItems="center">

             <img src={Logo} width={500} alt='Logo' style={
                 { 
                     objectFit: 'cover'
                 }
             }/>

             

        </Grid>
        <Grid item xs={4}   
            container
            direction="row"
            justifyContent="flex-end"
            alignItems="center" >

            <Box>
                <TextField fullWidth/>
            </Box>
        </Grid>






    </div>
  )
}

export default Login
